import React from 'react';
import './ShopHome.styles.scss'
import Directory from '../shop.components/directory/directory.component'
import { Switch, Route, Redirect, withRouter } from 'react-router-dom';
import ShopList from '../shopList/shopList.component'


const ShopHome = () => {


    const home = () => {
        return(
            <div className = "shophome">
                <Directory />
            </div>
        )
    }

    const Ramen = ({history}) => {
        return(
            <div>
                <h1>Ramen</h1>
                <ShopList />
            </div>
        )
    }

    return(
        <div >
            <Switch>
                <Route exact path='/shop' component={shophome} />
                <Route exact path='/shop/Ramen' component={Ramen} />
                <Redirect to='/home' />
            </Switch>
        </div>
    )
}

export default withRouter(ShopHome)
